string morganAndString1(string a, string b) {
    string result;
    char endChar = 'Z' + 1;
    a += endChar;
    b += endChar;

    while (a[0] != '\0' && b[0] != '\0') {
        if (a < b) {
            if (a[0] != endChar)
                result += a[0];

            a.erase(a.begin());
        }
        else {
            if(b[0] != endChar)
                result += b[0];

            b.erase(b.begin());
        }
    }

    if (a.size() > 1) {
        result.append(a, 0, a.size() - 1);
    }

    if (b.size() > 1) {
        result.append(b, 0, b.size() - 1);
    }

    return result;
}

// Complete the morganAndString function below.
string morganAndString(string a, string b) {
    string result;
    auto ia = 0, ib = 0;
    auto sizeA = a.size(), sizeB = b.size();

    while (ia < sizeA && ib < sizeB) {
        int indexA = ia, indexB = ib, checkResult = 0;
        do { // actually compare a and b.
            if (a[indexA] < b[indexB] && a[indexA] != '\0' || // a smaller
                b[indexB] == '\0') { // b ended.
                checkResult = 1; // a win.
                break;
            }

            if (a[indexA] > b[indexB] && b[indexB] != '\0' || // b smaller
                a[indexA] == '\0') { // a ended.
                checkResult = -1; // b win.
                break;
            }

            indexA++;
            indexB++;
        } while (checkResult == 0);

        if (checkResult == 1) {
            result += a[ia++];
        }
        else {
            result += b[ib++];
        }
    }

    // Copy the rest.
    if (sizeB > ib) {
        result.append(b, ib, sizeB - ib);
    }

    if (sizeA > ia) {
        result.append(a, ia, sizeA - ia);
    }

    return result;
}


bool test(string a, string b, string expected, int method) {
    string result;
    if (method == 0) {
        result = morganAndString(a, b);
    }
    else {
        result = morganAndString1(a, b);
    }

    return expected.compare(result);
}

